import React from 'react';
import './Logo.css';

const Logo = ({ size = 'medium', showText = true, className = '' }) => {
  return (
    <div className={`logo ${size} ${className}`}>
      <div className="logo-icon">
        <svg viewBox="0 0 100 100" className="house-icon">
          {/* House roof */}
          <path 
            d="M20 40 L50 15 L80 40 L80 85 L20 85 Z" 
            fill="none" 
            stroke="currentColor" 
            strokeWidth="2"
          />
          {/* House body */}
          <rect x="25" y="40" width="50" height="45" fill="none" stroke="currentColor" strokeWidth="2" />
          {/* Windows */}
          <rect x="32" y="50" width="8" height="8" fill="none" stroke="currentColor" strokeWidth="1.5" />
          <rect x="60" y="50" width="8" height="8" fill="none" stroke="currentColor" strokeWidth="1.5" />
          <rect x="32" y="65" width="8" height="8" fill="none" stroke="currentColor" strokeWidth="1.5" />
          <rect x="60" y="65" width="8" height="8" fill="none" stroke="currentColor" strokeWidth="1.5" />
          {/* Door */}
          <rect x="44" y="65" width="12" height="20" fill="none" stroke="currentColor" strokeWidth="1.5" />
        </svg>
      </div>
      {showText && (
        <div className="logo-text">
          <span className="logo-main">PRIMEBUILT</span>
          <span className="logo-subtitle">BROTHERS</span>
        </div>
      )}
    </div>
  );
};

export default Logo;
